<template>
    <div class="IEmptyContainer flex-column-center">
        <div class="IEmpty " :class="{ plain }" :style="[styleOption]"></div>
        <UIRich :color="color" :node="tip" v-if="tip"/>
    </div>
</template>

<script lang="ts" setup>
    import { computed } from "vue"
    import { mapStores } from "pinia";
    import { ComputedRef, StyleValue } from "vue";
    import { useThemeStore } from "../../theme";
    import { genPx } from "../../common/style";
    import UIRich from "../Rich/index.vue"
    const props = defineProps({
        width: {
            type: String,
            default: "325"
        },
        height: {
            type: String,
            default: "325"
        },
        plain: Boolean,
        tip: String
    });
    const store = mapStores(useThemeStore).themeStoreStore();
    const color = computed(() => store.theme?.colorTextQuaternary);
    const styleOption: ComputedRef<StyleValue> = computed((): StyleValue => {
        return {
            width: genPx(props.width),
            height: genPx(props.height)
        }
    });
</script>

<style lang="scss">
.IEmptyContainer {
    .IEmpty {
        background-position: center center;
        background-size: auto 80%;
        background-repeat: no-repeat;
        background-image: url(data:image/png;base64,);
        margin: auto auto;
        width: 325rpx;
        height: 325rpx;
        &.plain {
            background-image: url(data:image/png;base64,);
        }
    }
}
</style>